import React from 'react';
import { Table, TableHead, TableBody, TableRow, TableCell } from '@mui/material';
import './societyTable.css'; // Import CSS file for styling

const SocietyTable = () => {
  const data = [
    { id: 1, name: 'John Doe', address: '123 Main St' },
    { id: 2, name: 'Jane Smith', address: '456 Elm St' },
    { id: 3, name: 'Alice Johnson', address: '789 Oak St' }
  ];

  return (
    <div className="table-container"> {/* Container to center the table */}
      <Table size="small"> {/* Make the table smaller */}
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>Address</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((item) => (
            <TableRow key={item.id}>
              <TableCell>{item.id}</TableCell>
              <TableCell>{item.name}</TableCell>
              <TableCell>{item.address}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </div>
  );
};

export default SocietyTable;
